import React from 'react';
import './App.css';

const App = () => {
  return (
    <div>
      <div>one div</div>
      <div className="App">
        <ul>
          <li>css</li>
          <li>html</li>
          <li>js</li>
          <li>react</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
